property.lessCode:
/*
 * A couple of new variables specific to our color theme, to be used only for initializing other vars, not directly.
 */
@gcaa-orange     : #EBB000;
@gcaa-green      : #85b800; // the blue needs to be taken from headings color, it's set in the color theme

/*
 * FONTS: roboto condensed for titles
 */
@import url('https://fonts.googleapis.com/css?family=Roboto+Condensed');

/* headings get heading font */
@headings-font-family : 'Roboto Condensed';
/* Capitalize headings */
h1, h2, h3, h4, h5, h6,
.h1, .h2, .h3, .h4, .h5, .h6 {
    text-transform: uppercase;
}

/*
 * NOT-READY elements are faded out. Class can be used anywhere.
 */
.gcaa-notready {
  opacity: 0.5;
}

/*
 * MENU COLORS AND CUSTOMIZATIONS.
 */

/*
 * Color the menu in MY color, not the navigation menu's color. We need to find a platform solution for this, because it's ridiculous 
 */
/*
 *Replacing navbar-default-* colors with menuapp-menu-* colors, to keep the same level of customizability, if ever needed...
 */
@menuapp-menu-bg            : @gcaa-orange; //@navbar-default-bg
@menuapp-menu-link-color    : #FFFFFF; //@navbar-default-link-color
@menuapp-menu-border        : @menuapp-menu-bg; //@navbar-default-border

@menuapp-menu-link-hover-color    : @menuapp-menu-link-color; //@navbar-default-link-hover-color
@menuapp-menu-link-active-color   : @menuapp-menu-link-color; //@navbar-default-link-active-color
@menuapp-menu-link-hover-bg       : @menuapp-menu-bg; // @navbar-default-link-hover-bg
@menuapp-menu-link-active-bg      : @menuapp-menu-bg; //@navbar-default-link-active-bg

/* Custom dropdown colors - replacing @dropdown-* with @menuapp-dropdown-* */
@menuapp-dropdown-bg                  : @menuapp-menu-bg; //@dropdown-bg
@menuapp-dropdown-link-hover-bg       : lighten(@menuapp-dropdown-bg, 20%); //@dropdown-link-hover-bg
@menuapp-dropdown-link-color          : @menuapp-menu-link-color; //@dropdown-link-color;
@menuapp-dropdown-link-hover-color    : @menuapp-dropdown-link-color; //@dropdown-link-hover-color



/* 
 * All this Less is copied from the menu SSX, and just replaced the usage of navbar-default-* variables with menuapp-menu-* variables 
 * Only diff is the div. element, cause we need to make the rules more specific 
 */
div.menu {
  &.menu-horizontal {
    background-color: @menuapp-menu-bg;
    border-color: @menuapp-menu-border;
    & > ul {
      & > li {
        color: @menuapp-menu-link-color;
        &:hover {
          color: @menuapp-menu-link-hover-color;
          background-color: @menuapp-menu-link-hover-bg;
          background-color: @menuapp-menu-link-active-bg;
          & > span > a {
            background-color: @menuapp-menu-link-active-bg;
            color: @menuapp-menu-link-active-color;
          }
        }
        a {
          color: @menuapp-menu-link-color;
        }
      }
      /* Stylization: Dropdowns */
      ul {
        background-color: @menuapp-dropdown-bg;
        li {
          color: @menuapp-dropdown-link-color;
          a {
            color: @menuapp-dropdown-link-color;
            &:hover {
              color: @menuapp-dropdown-link-hover-color;
              background-color: @menuapp-dropdown-link-hover-bg;
            }
          }
          /* Submenus inside menu */
          &.xDropdown {
            color: @menuapp-dropdown-link-color;
            &:hover {
              color: @menuapp-dropdown-link-hover-color;
              background-color: @menuapp-dropdown-link-hover-bg;
              & > span > a {
                color: @menuapp-dropdown-link-hover-color;
              }
            }
          }
        }
      }
    }
  }
}

div.menu-horizontal-collapsible-container {
  background-color: @menuapp-menu-bg;
  border-color: @menuapp-menu-border;
  button.navbar-toggle {
    color: @menuapp-menu-link-color;
    &:hover {
      color: @menuapp-menu-link-hover-color;
      background-color: @menuapp-menu-link-hover-bg;
    }
  }
}

/* And some customizations other than the colors*/
div.menu {
  &.menu-horizontal {
    box-shadow: none;
    font-family: @headings-font-family;
    text-transform: uppercase;
    & > ul {
      ul {
        border: none;
        border-radius: 0;
        box-shadow: none;
        padding: 0;
        li a {
          padding: 10px 15px;
        }
      }
    }
  }
}

/* don't wrap spaces on submenus other than mobile, so that the submenus are not limited to 160px; and stretch their parent */
@media (min-width: @screen-sm-min) {
  div.menu {
    &.menu-horizontal {
      & > ul {
        ul {
          white-space: nowrap;
        }
      }
    }
  }
}

